 natural weight loss detox tea formulated\r\nwith natural herbs like cassia seeds, hemp kernel and green tea. It is a 28-day\r\ndetox tea that flushes body fat while detoxifying the system. This tea is made\r\nup of the finest ingredients with weight loss enhancing properties. It is mild\r\nand pleasant in taste & texture. Its aids weight loss by increasing\r\nmetabolism, which accelerates fat burn and calorie expenditure. Fit-tea is\r\nknown as the fast-natural route to an effective weight loss. It promotes\r\ncleansing, detoxification and healthy digestion. It soothes the stomach, curbs\r\nhunger, and flushes fat naturally. It also helps suppress appetite and reduce\r\nfood cravings. </p>\r\n\r\n', '<p>Fit tea is a 100% natural weight loss detox tea formulated\r\nwith natural herbs like cassia seeds, hemp kernel and green tea.</p>', '', '<p><!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG/>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--><!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:EnableOpenTypeKerning/>\r\n   <w:DontFlipMirrorIndents/>\r\n   <w:OverrideTableStyleHps/>\r\n   <w:UseFELayout/>\r\n  </w:Compatibility>\r\n  <m:mathPr>\r\n   <m:mathFont m:val=\"Cambria Math\"/>\r\n   <m:brkBin m:val=\"before\"/>\r\n   <m